window.bookSummaryJSON = "<p><b><i>It is the mettle to proceed that matters....</i></b></p> <p>The Labyrinth behind him, Terry and company arrive on the Eastern Steppes in the midst of a carnival, and a fateful decision puts him under a dire curse. Stripped of his bond powers and exiled to the dreamlike Wildervast, he must find and free the ultimate witch, then kill an invincible man.&nbsp;</p> <p>Meanwhile, those left behind must face the machinations of the tauren herd leaders, whose law allows them to take a template for common use, and the remnants of Theseus' bonds in search of revenge.&nbsp;</p> <p>Beyond all, there remain the inscrutable machinations of Vlad the Dreamer, and the immortal might of the Twilight Zone's gorgon, Stheno.&nbsp;</p> <p><b><i>Warning: This book does not pan to waving curtains and fade to black. Those uninterested or under the age of 18 are strongly warned of explicit content.</i></b></p>"; 
